import React from 'react';
import Carousel from 'react-multi-carousel';
import '../styles/CategoryButtons.css';
import 'react-multi-carousel/lib/styles.css'; // Ensure to import Carousel styles

const responsive = {
  superLargeDesktop: {
    // the naming can be any, depends on you.
    breakpoint: { max: 4000, min: 3000 },
    items: 5,
  },
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 3,
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2,
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1,
  },
};

const CategoryButtons = () => {
  // CategoryButtons component logic and JSX here
  // ...
};

const images = [
  '../images/birds/parrot2.jpeg',
  '../images/cats/cat1.jpg',
  '../images/fishes/greenarowana1.jpeg',
  '../images/birds/parrot1.jpg.jpg',
  '../images/dogs/dog2.jpg.jpg',
  // Add more image paths as needed
];



const MultiItemCarousel = () => {
  return (
    <Carousel responsive={responsive}>
      {/* Map through your images or content and render carousel items */}
         <Carousel responsive={responsive}>
      {images.map((image, index) => (
        <Carousel.Item key={index}>
          <img
            className="d-block w-100"
            src={image}
            alt={`Slide ${index + 1}`}
          />
        </Carousel.Item>
      ))}
    </Carousel>
  );
      <div><h3>Item 1</h3></div>
      <div><h3>Item 2</h3></div>
      <div><h3>Item 3</h3></div>
      <div><h3>Item 4</h3></div>
      <div><h3>Item 5</h3></div>
      {/* ... more items */}
    </Carousel>
  );
};

// Decide which component you want to export by default, you cannot have two default exports.
export default MultiItemCarousel;
